import React from "react";
import { IconButton, Toolbar, AppBar } from "@material-ui/core";
import { makeStyles } from "@material-ui/styles";
import { InsertLink } from "@material-ui/icons";
import Autocomplete from "@material-ui/lab/Autocomplete";

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: theme.palette.type === "dark" ? "#1e1e1e" : "#ffffff",
    opacity: 0.85,
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  grow: {
    flexGrow: 1,
  },
  cardLink: {
    textDecoration: "none",
    color: theme.palette.type === "dark" ? "#fbfbfb" : "#1e1e1e",
  },
}));

function AppBarChild() {
  const classes = useStyles();
  const [nameMovie, setNameMovie] = React.useState("");
  return (
    <AppBar position="absolute" className={classes.appBar}>
      <Toolbar disableGutters variant="dense">
        <div className={classes.grow} />
        <Autocomplete onChange={(e, v) => setNameMovie(!v ? "" : v.Title)} />
        <IconButton aria-label="Site">
          <a
            target="_blank"
            aria-label="Site"
            rel="noopener noreferrer"
            href={"https://sthima.com.br/"}
            className={classes.cardLink}
          >
            <InsertLink fontSize="small" />
          </a>
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}

export default AppBarChild;
